import React from 'react'
import './gallery.css'
import Img1 from '../../images/potrait-1.jpg'


const Gallery = () => {

    let data=[
        {
            id:1,
            imgSrc:Img1,
        },
        {
            id:2,
            imgSrc:Img1,
        },
        {
            id:3,
            imgSrc:Img1,
        },
        {
            id:4,
            imgSrc:Img1,
        },
        {
            id:5,
            imgSrc:Img1,
        },
        {
            id:6,
            imgSrc:Img1,
        },
    ]

    return (
        <>
           <h1>Image Gallery</h1>
           <div className='gallery'>
               {data.map((item,index) =>{
                   return(
                       <div className='pics' key={index}>
                           <img style={{width: '320px' ,height: '320px'}} src={item.imgSrc}/ >
                       </div>    
                   )
               })}
           </div>
        </>
    )
}

export default Gallery
